import React, { Component } from 'react'
import Table from './Table'
import Nav from './Nav'
import 'bootstrap/dist/css/bootstrap.min.css';


class App extends Component {
  render() {
    return (
      <div className="container">
        <Nav />
        <Table />
      </div>
    )
  }
}

export default App
